import React from 'react';
import Review from './Review';
import classes from "./Reviews.module.css"

const Reviews = () => {
    return (
        <div className = {classes.wrap}>
            <h2>Отзывы</h2>
            <div className = {classes.reviewWrap}>
                <Review text="1"/>
                <Review text="2"/>
                <Review text="3"/>
                <Review text="4"/>

            </div>

        </div>
    );
}

export default Reviews;
